Parses.Sparql:
#MANUAL SPARQL
PREFIX ns: <http://rdf.freebase.com/ns/>
SELECT DISTINCT ?x
WHERE {
  ns:m.06x5s ns:time.recurring_event.instances ?x . # Super Bowl instances

  {
    ?x ns:sports.sports_championship_event.champion ns:m.05gg4 . # giants
  }
  UNION
  {
    ?x ns:sports.sports_championship_event.runner_up ns:m.05gg4 . # giants
  }
  ?x ns:time.event.start_date ?st .
}
ORDER BY DESC(xsd:datetime(?st))
LIMIT 1

